var React = require('react');

class Print extends React.Component{
    constructor(props){
        super(props);
        this.state = {sillon:"",pabellon:"",recuperacion:"",equipo:"",equipamiento:""}
        this.handlePrint = this.handlePrint.bind(this)
    }
    handlePrint(){
        this.state.sillon = this.props.sillon? "Sí":"No";
        this.state.pabellon = this.props.pabellon? "Sí":"No";
        this.state.recuperacion = this.props.recuperacion? "Sí":"No";
        this.state.equipo = this.props.equipo ? "Sí":"No";
        this.state.equipamiento = this.props.equipamiento ? "Sí":"No";
    }

     
    render(){
        return(
            
 
            <div classname = "centro" onDisplay = {this.handlePrint()}> 
                    Ingresado paciente satisfactoriamente con<br />
                    Nombre: {this.props.nombre} <br />
                    Rut: {this.props.rut} <br />
                    Sillón: {this.props.sillon}<br />
                    Pabellón: {this.props.pabellon}<br />
                    Sala de recuperación: {this.props.recuperacion}<br />
                    Equipo: {this.props.equipo}<br />
                    Equipamiento: {this.props.equipamiento}<br />
                    <p hidden = {(this.props.equipo)? "":"hidden"}>Tipo de equipo: {this.props.tipoequipo}</p><br />
                    <p hidden = {(this.props.equipamie)? "":"hidden"}>Tipo de equipamiento: {this.props.tipoequipamiento}</p><br />
                 </div>

                        );
    }
};

export default Print;
